import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component{
    state = {
        isLoggedIn: false,
        activeUrls : {
            register : false,
            login : false,
            news : false, 
            products: false
        }
    }
    onChange = (e) => {
        e.preventDefault();
        this.props.activePathMethod("/register")
    }
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link onChange={this.onChange} style={linkStyle} to="/register">Register</Link></h2>
                    <hr/>            
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}


export default Navbar;
